import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaBolt, FaChartLine, FaBuilding, FaUser } from 'react-icons/fa';
import './Home.css';

const Home = () => {
  const navigate = useNavigate();

  const stats = [
    { title: "Consumo Total", value: "1,250 kWh", icon: <FaBolt />, className: "stat-card blue" },
    { title: "Registros Hoy", value: "5", icon: <FaChartLine />, className: "stat-card green" },
    { title: "Centros Activos", value: "3", icon: <FaBuilding />, className: "stat-card purple" },
    { title: "Usuarios", value: "4", icon: <FaUser />, className: "stat-card yellow" }
  ];

  return (
    <div className="home-container">
      <h1 className="home-title">Panel de Control Energético</h1>

      <div className="stats-grid">
        {stats.map((stat, index) => (
          <div key={index} className={stat.className}>
            <div>
              <p className="stat-title">{stat.title}</p>
              <p className="stat-value">{stat.value}</p>
            </div>
            <span className="stat-icon">{stat.icon}</span>
          </div>
        ))}
      </div>

      <div className="quick-actions">
        <h2>Acciones Rápidas</h2>
        <div className="button-group">
          <button onClick={() => navigate('/registros/nuevo')} className="btn blue">
            <FaBolt /> Nuevo Registro
          </button>
          <button onClick={() => navigate('/registros')} className="btn green">
            <FaChartLine /> Ver Todos
          </button>
        </div>
      </div>

      <div className="chart-section">
        <h2>Consumo Mensual</h2>
        <div className="chart-placeholder">
          [Área para gráfico de consumo]
        </div>
      </div>

      <div className="debug-message">
        <p><strong>Debug:</strong> Componente Home renderizado correctamente</p>
        <p className="debug-small">Si ves este mensaje, el componente se está mostrando</p>
      </div>
    </div>
  );
};

export default Home;
